    //               {/* Email field */}

    //               <FormGroup>
    //                 <Label for="email">Enter Email</Label>
    //                 <Input
    //                   type="text"
    //                   id="email"
    //                   value={loginDetail.username}
    //                   onChange={(e) => handleChange(e, "username")}
    //                 />
    //               </FormGroup>

    //               {/* password field */}

    //               <FormGroup>
    //                 <Label for="password">Enter password</Label>
    //                 <Input
    //                   type="password"
    //                   id="password"
    //                   value={loginDetail.password}
    //                   onChange={(e) => handleChange(e, "password")}
    //                 />
    //               </FormGroup>

    //               <Container className="text-center">
    //                 <Button color="light" outline>
    //                   Login
    //                 </Button>
    //                 <Button onClick={handleReset} className="ms-2" outline color="secondary">
    //                   Reset
    //                 </Button>
    //               </Container>
    //             </Form>
    //           </CardBody>
    //         </Card>
    //       </Col>
    //     </Row>
    //   </Container>
    // </Base>
    <Base>
      <Container>
        <Row className="mt-4">
          <Col
            sm={{
              size: 6,
              offset: 0,
            }}
          >
            <Container className="mt-5">
              <br></br>
              <br></br>
              <br></br>
              <br></br>
              <br></br>
              <Link style={{ textDecoration: "none" }} tag={ReactLink} to="/">
                <h1 className="text-warning">MyBlog</h1>
              </Link>
              <p>
                <b>it helps you share your Knowledge,with the world.</b>
              </p>
            </Container>
          </Col>
          <Col
          //   sm={{
          //     size: 5,
          //     offset: 7,
          //   }}
          >
            <Container className="mt-5 col-11">
              <br></br>
              <br></br>
              <Card className="shadow p-3 mb-5 bg-white rounded">
                <CardBody>
                  <Form onSubmit={handleFormSubmit}>
                    {/* Email field */}
                    <br></br>

                    <FormGroup>
                      <Input
                        type="text"
                        id="email"
                        placeholder="Email address"
                        value={loginDetail.username}
                        onChange={(e) => handleChange(e, "username")}
                      />
                    </FormGroup>

                    {/* password field */}

                    <FormGroup>
                      <Input
                        type="password"
                        id="password"
                        placeholder="Password"
                        value={loginDetail.password}
                        onChange={(e) => handleChange(e, "password")}
                      />
                    </FormGroup>

                    <Container className="text-center">
                      <Button color="success">Login</Button>
                      <Button
                        onClick={handleReset}
                        className="ms-2"
                        color="secondary"
                      >
                        Reset
                      </Button>
                      <br></br>
                    </Container>
                  </Form>
                </CardBody>
                <CardFooter>
                  <Container className="text-center">
                    <p>Don't have accout yet?</p>
                    <Link
                      style={{ textDecoration: "none" }}
                      tag={ReactLink}
                      to="/signup"
                    >
                      <Button color="warning">Create New Account</Button>
                    </Link>
                    <h6>&nbsp;</h6>
                  </Container>
                </CardFooter>
              </Card>
            </Container>
          </Col>
        </Row>
      </Container>
    </Base>
  );
};

export default Login;
